// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.16 <0.9.0;
pragma experimental ABIEncoderV2;

contract ListsStorage {
    // 结构体
    struct User {
        uint id;
        string name;
        uint8 age;
        address account;
    }

    // 动态数组
    User[] public UserList; //使用public自动生成getter方法，'[]'内有数字表示限制长度，没有就是动态的

    function addList(string memory _name,uint8 _age) public returns (uint) {
       uint count = UserList.length;
       uint index = count + 1;
       // index作为id删除时会混乱
       UserList.push(User(index,_name,_age,msg.sender));
       return UserList.length;
    }

    // This type is only supported in ABI coder v2. Use "pragma abicoder v2;"=>pragma experimental ABIEncoderV2;
    function getList() public view returns(User[] memory) {
        return UserList;
    }
}
